import React from 'react';
import Button from './Button';

const ModalContent = ({ title, items = []}) => {
    return (
        <div>
            <h3>"List of repositories"</h3>
            <div>
                {items.length !== 0  &&
                items.map((item, id) => {
                        return(
                        <div key={id}>
                            <div>
                            <h5>{item.name}</h5>
                            </div> 
                        </div>
                        )
                    }
                )
            }

            {items.length !== 0 && (
                <Button  />
            )
            }
            </div>
        </div>
    );
}

export default ModalContent;
